import React from "react";
import "../design/Home.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Logo from "../components/logo";

export default class Home extends React.Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-4 graySidebar d-flex flex-column">
            <Logo />
            <img
              src="https://image.flaticon.com/icons/svg/168/168882.svg"
              style={{
                height: "50%",
                width: "50%",
                borderSpacing: "5px"
              }}
              className="mt-30 mb-10 align-self-center"
            ></img>
            <h1 className="align-self-center" style={{ fontSize: "50px" }}>
              Jayansh
              <br /> Bhartiya
            </h1>
          </div>
          <div className="col-md-8 whiteCarryover">
            <div className="container p-4">
              <h1
                style={{
                  paddingBottom: "5px",
                  borderBottom: "yellow solid 5px",
                  fontWeight: "thin"
                }}
              >
                Hey there, it's <b>Jayansh</b>
              </h1>
              <h2> He</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
